import React, { useState } from "react";
import { Navbar, Button, Table, Modal, Form } from "react-bootstrap"; // Import Modal and Form from react-bootstrap
import { useNavigate } from "react-router-dom";
import Logo from "../../Images/Logo1.png";
import FileUpload from "./FileUpload";

function Manager() {
  const navigate = useNavigate();
  const [showModal, setShowModal] = useState(false); // State variable to control modal visibility

  const handleLogout = () => {
    navigate("/");
  };

  const handleAddProject = () => {
    setShowModal(true); // Show the modal when the "Add Project" button is clicked
  };

  const handleCloseModal = () => {
    setShowModal(false); // Close the modal when needed
  };

  const handleSubmit = (e: any) => {
    e.preventDefault();
    // Handle form submission logic here
    // You can access the form values using state or refs
    // After processing, close the modal if needed
    handleCloseModal();
  };

  return (
    <div>
      <Navbar>
        <img src={Logo} alt="Logo" className="logo-1" />
        <Button
          variant="transparent"
          className="logout-btn"
          onClick={handleLogout}
        >
          Logout
        </Button>
      </Navbar>

      <div className="sidebar">
        <ul>
          <li>Home</li>
          <li>Services</li>
          <li>Options</li>
          <li>About Us</li>
          <li>Contact Us</li>
        </ul>
      </div>

      <div className="projects-table">
        <h2>Projects</h2>
        <Table striped bordered hover>
          <thead>
            <tr>
              <th className="d-flex justify-content-between align-items-center">
                Project Name
                <Button
                  variant="transparent"
                  size="sm"
                  className="buttons"
                  onClick={handleAddProject} // Open the modal when "Add Project" is clicked
                >
                  Add Project
                </Button>
              </th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td>
                <FileUpload />
              </td>
            </tr>
          </tbody>
        </Table>
      </div>

      {/* Modal for adding a project */}
      <Modal show={showModal} onHide={handleCloseModal}>
        <Modal.Header closeButton>
          <Modal.Title>Add Project</Modal.Title>
        </Modal.Header>
        <Modal.Body>
  <Form onSubmit={handleSubmit}>
    <Form.Row>
      <Form.Group as={Col} controlId="projectName" sm={6}>
        <Form.Label>Project Name</Form.Label>
        <Form.Control type="text" placeholder="Enter project name" />
      </Form.Group>
      <Form.Group as={Col} controlId="description" sm={6}>
        <Form.Label>Description</Form.Label>
        <Form.Control as="textarea" rows={3} placeholder="Enter project description" />
      </Form.Group>
    </Form.Row>
    <Button variant="primary" type="submit">
      Submit
    </Button>
  </Form>
</Modal.Body>

      </Modal>
    </div>
  );
}

export default Manager;
